import React, { useState } from "react";

function RandomNumber(props) {
  const [random, setRandom] = useState(0);

  return (
    <div>
      <h2>랜덤 숫자 생성기</h2>
      <hr />
      <button onClick={() => setRandom(Math.floor(Math.random() * 100))}>
        Start
      </button>
      <h3>랜덤난수 : {random}</h3>
    </div>
  );
}

export default RandomNumber;
